import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';

function Preloader() {
  const navigate = useNavigate();
  const message = "Wat objects hold meaning to you?";
  const [typewriterText, setTypewriterText] = useState("");

  useEffect(() => {
    let i = 0;
    const intervalId = setInterval(() => {
        console.log(i);
        if (i < message.length) {
            setTypewriterText(prevText => prevText + message[i]);
            i++;
        } else {
            clearInterval(intervalId);
            // Navigate to home after the message is fully typed
            setTimeout(() => {
            navigate('/home');
            }, 500); // Adjust the delay after typing completes
        }
    }, 150); // Adjust typing speed here

    return () => clearInterval(intervalId);
  }, [message, navigate]);

  return (
    <div className="preloader">
      <h1>{typewriterText}</h1>
      {/* You can add more styling or a spinner here */}
    </div>
  );
}

export default Preloader;
